import React from 'react';
import "./NavTab.css";
import {Link} from "react-router-dom";
import AboutProject from "../AboutProject";

const NavTab = () => {
    return (
        <section className="main-navbar">
            <nav className="main-navbar__container">
                <li className="main-navbar__list-item"><Link to={AboutProject} className="main-navbar__link">О проекте</Link>
                </li>
                <li className="main-navbar__list-item"><a href="" className="main-navbar__link">Технологии</a>
                </li>
                <li className="main-navbar__list-item"><a href="" className="main-navbar__link">Студент</a></li>
            </nav>
        </section>
    );
};

export default NavTab;
